// src/App.js
import React, { useEffect, useState } from "react";
import axios from "axios";
import { MapContainer, TileLayer, Marker, Popup } from "react-leaflet";
import "leaflet/dist/leaflet.css";
import Chart from "chart.js/auto";

function App() {
  const [buoys, setBuoys] = useState([]);
  const [selected, setSelected] = useState(null);
  const [loading, setLoading] = useState(true);
  const [error, setError] = useState(null);
  const [chartInstance, setChartInstance] = useState(null);

  // fetch buoy list from backend
  useEffect(() => {
    axios
      .get("http://localhost:5000/api/buoys")
      .then((r) => {
        if (r.data && r.data.buoys) {
          setBuoys(r.data.buoys);
        } else {
          setError("No buoy data received");
        }
      })
      .catch((err) => {
        setError("Failed to fetch buoy list");
        console.error(err);
      })
      .finally(() => setLoading(false));
  }, []);

  // fetch buoy details + render chart
  useEffect(() => {
    if (!selected) return;

    axios
      .get(`http://localhost:5000/api/buoy/${encodeURIComponent(selected.id)}`)
      .then((r) => {
        const detail = r.data?.data || {};
        console.log("buoy detail", detail);

        // destroy previous chart if exists
        if (chartInstance) {
          chartInstance.destroy();
        }

        // dummy chart data if real timeseries not available
        const timestamps = detail.timestamps || [
          "00:00",
          "01:00",
          "02:00",
          "03:00",
          "04:00",
        ];
        const values = detail.values || [1, 2, 1.5, 2.2, 1.8];

        const ctx = document.getElementById("buoyChart")?.getContext("2d");
        if (ctx) {
          const newChart = new Chart(ctx, {
            type: "line",
            data: {
              labels: timestamps,
              datasets: [
                {
                  label: `${selected.name} readings`,
                  data: values,
                  borderColor: "blue",
                  tension: 0.3,
                  fill: false,
                },
              ],
            },
            options: {
              responsive: true,
              plugins: {
                legend: { display: true },
              },
              scales: {
                x: { title: { display: true, text: "Time" } },
                y: { title: { display: true, text: "Value" } },
              },
            },
          });
          setChartInstance(newChart);
        }
      })
      .catch((err) => {
        console.error("Buoy detail fetch failed", err);
      });
  }, [selected]);

  if (loading) return <h2>Loading buoys...</h2>;
  if (error) return <h2 style={{ color: "red" }}>{error}</h2>;

  return (
    <div style={{ display: "flex", height: "100vh" }}>
      {/* Sidebar */}
      <div style={{ width: 360, overflow: "auto", padding: 12 }}>
        <h3>INCOIS Buoys</h3>
        <ul>
          {buoys.map((b) => (
            <li key={b.id}>
              <button
                onClick={() => setSelected(b)}
                style={{ cursor: "pointer" }}
              >
                {b.name}
              </button>
            </li>
          ))}
        </ul>

        {selected && (
          <div style={{ marginTop: 20 }}>
            <h4>{selected.name} â€“ Details</h4>
            <p>
              Lat: {selected.lat ?? "N/A"}, Lon: {selected.lon ?? "N/A"}
            </p>
            <canvas id="buoyChart" width="320" height="200"></canvas>
          </div>
        )}
      </div>

      {/* Map */}
      <div style={{ flex: 1 }}>
        <MapContainer center={[15, 80]} zoom={4} style={{ height: "100%" }}>
          <TileLayer
            attribution="&copy; OpenStreetMap contributors"
            url="https://{s}.tile.openstreetmap.org/{z}/{x}/{y}.png"
          />
          {buoys.map((b, i) => {
            const lat = b.lat ?? 15 + i * 0.5;
            const lon = b.lon ?? 80 + i * 0.5;
            return (
              <Marker key={b.id} position={[lat, lon]}>
                <Popup>
                  <strong>{b.name}</strong>
                  <br />
                  <button onClick={() => setSelected(b)}>Details</button>
                </Popup>
              </Marker>
            );
          })}
        </MapContainer>
      </div>
    </div>
  );
}

export default App;
